webpackJsonp([0x95fe48a228bc],{3413:function(n,l){n.exports={data:{markdownRemark:{html:'<p><strong>🌡26℃ ☀</strong></p>\n<p>珍しく早起きしたので LEGO ブロックで建物や乗り物などを作りました。</p>\n<ul>\n<li>電気スタンド</li>\n<li>看板</li>\n<li>バス</li>\n<li>レッカー車</li>\n<li>家</li>\n<li>飛行機</li>\n<li>飛行船</li>\n</ul>\n<p>止め忘れた目覚まし時計が鳴って、昨日見るのを忘れていた『がんばれ!!タブチくん!!』の録画を見ました。</p>\n<p>それから少し遅めの朝食をとっていると、S 君が遊びに来たので、ファミコンをやって一緒に昼食を食べたら、親父の趣味の F1 レースのテレビ観戦が始まりました。</p>\n<p>暫くテレビが占領されそうな具合だったので、僕は S 君と一緒に<a href="../09/24-diary.md">先週マッピングした公園</a>へ遊びに行きました。</p>\n<p>帰ったら残っている宿題を片付けて、まだ時間に余裕があったので『ドラえもん のび太とアニマル惑星』を鑑賞しました。</p>',frontmatter:{cover:null,date:"1990-10-02T23:30:00+09:00",strDate:"1990/10/2",title:"日記"}}},pathContext:{path:"/ja/blog/1990/10/01-diary/",langKey:"ja"}}}});
